def getPointUplinks(point):
	uplinks = []

	for fcount in point:
		records = []
		for i, received in enumerate(fcount):
			if not math.isnan(float(received)):
				records.append([gateways[i].lat, gateways[i].lon, "ballec", received])
		uplinks.append(records)
	return uplinks


